export const Imaged = ({ stepType }) => {
  switch (stepType) {
    case "is_invite_accepted":
      return <flowIcons.AcceptLinkedInvite />;
    case "is_msg_opened":
      return <flowIcons.OpenLinkedMessage />;
    case "is_email_opened":
      return <flowIcons.OpenEmail />;
    case "has_email":
      return <flowIcons.HasEmail />;
    case "has_email_replied":
      return <flowIcons.ClickedLinkEmail />;
    case "has_msg_replied":
      return <flowIcons.LinkedinComment />;
    case "has_linkedin_url":
      return <flowIcons.HasLinkedinUrl />;
    case "is_clicked_link_email":
      return <flowIcons.ClickedLinkEmail />;
    case "send_connection":
      return <flowIcons.AcceptLinkedInvite />;
    case "send_msg":
      return <flowIcons.SendLinkedinMessage />;
    case "send_voice":
      return <flowIcons.SendLinkedinVocie />;
    case "like_last_post":
      return <flowIcons.LinkedIn />;
    case "send_email":
      return <flowIcons.Email />;
    case "comment_last_post":
      return <flowIcons.LinkedinComment />;
    default:
      return <p className="invisible">none</p>;
  }
};

